import { StatusBar } from 'expo-status-bar';
import React from 'react';

import { StyleSheet, Text, View } from 'react-native';

import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import HomeScreen from './components/Home';
import ProfileScreen from './components/ProfileScreen';
import ApiScreen from './components/ApiScreen';

const Stack = createNativeStackNavigator();

export default class App extends component {
  render() {
    return (
      <NavigationContainer>
        <Stack.Navigator >
          <Stack.Screen
            name="Home"
            component={HomeScreen}
            options={{ headerLayoutPreset: 'center' }, { alignSelf: 'center' }, { headerShown: false }}
          />
          <Stack.Screen name="ProfileScreen" component={ProfileScreen} options={{ headerShown: true }} />
          <Stack.Screen name="new Screen" component={ApiScreen} options={{ headerShown: false }} />
        </Stack.Navigator>
      </NavigationContainer>

    );
  }

};
